     &CALL ERRQUIT('ccsdtq_lambda1_5',0,MA_ERR)
      CALL DFILL(two*dimc,0.0d0,dbl_mb(k_c_sort),1)
      DO h10b = 1,noab
      DO p11b = noab+1,noab+nvab
      IF (int_mb(k_spin+h2b-1)+int_mb(k_spin+h10b-1) .eq. int_mb(k_spin+
     &p1b-1)+int_mb(k_spin+p11b-1)) THEN
      IF (ieor(int_mb(k_sym+h2b-1),ieor(int_mb(k_sym+h10b-1),ieor(int_mb
     &(k_sym+p1b-1),int_mb(k_sym+p11b-1)))) .eq. irrep_y) THEN
      CALL TCE_RESTRICTED_4(h2b,h10b,p1b,p11b,h2b_1,h10b_1,p1b_1,p11b_1)
