     &CALL ERRQUIT('ccsdtq_lambda1_5',1,MA_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dima,'noname',l_a,k_a)) CALL ERRQU
     &IT('ccsdtq_lambda1_5',2,MA_ERR)
      IF ((h10b .lt. h2b) .and. (p11b .lt. p1b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(p1b_1
     & - noab - 1 + nvab * (p11b_1 - noab - 1 + nvab * (h2b_1 - 1 + noab
     & * (h10b_1 - 1)))))
