     &),int_mb(k_range+h2b-1),int_mb(k_range+p11b-1),int_mb(k_range+p1b-
     &1),4,2,3,1,1.0d0,.false.)
      END IF
      IF ((h10b .lt. h2b) .and. (p1b .le. p11b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(p11b_
     &1 - noab - 1 + nvab * (p1b_1 - noab - 1 + nvab * (h2b_1 - 1 + noab
     & * (h10b_1 - 1)))))
      CALL TCE_SORT_4(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+h10b-1
     &),int_mb(k_range+h2b-1),int_mb(k_range+p1b-1),int_mb(k_range+p11b-
     &1),3,2,4,1,-1.0d0,.false.)
      END IF
      IF ((h2b .le. h10b) .and. (p11b .lt. p1b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(p1b_1
     & - noab - 1 + nvab * (p11b_1 - noab - 1 + nvab * (h10b_1 - 1 + noa
     &b * (h2b_1 - 1)))))
      CALL TCE_SORT_4(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+h2b-1)
