     &)+int_mb(k_spin+h9b-1)+int_mb(k_spin+p3b-1).ne.8)) THEN
      addr = addr + 1
      dbl_mb(k_a_offset+addr) = dfloat(p3b - noab - 1 + nvab * (h9b - 1 
     &+ noab * (h7b - 1 + noab * (h2b - 1))))
      dbl_mb(k_a_offset+length+addr) = size
      size = size + dfloat(int_mb(k_range+h2b-1)) * dfloat(int_mb(k_rang
     &e+h7b-1)) * dfloat(int_mb(k_range+h9b-1)) * dfloat(int_mb(k_range+
     &p3b-1))
