     &CALL ERRQUIT('ccsdtq_lambda1_6_2_2_2',1,MA_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dima,'noname',l_a,k_a)) CALL ERRQU
     &IT('ccsdtq_lambda1_6_2_2_2',2,MA_ERR)
