     & noab - 1 + nvab * (h9b - 1 + noab * (h7b - 1 + noab * (h2b - 1)))
     &))
      IF (.not.MA_POP_STACK(l_c)) CALL ERRQUIT('ccsdtq_lambda1_6_2_2_2',
