     &,MA_ERR)
      IF (.not.MA_POP_STACK(l_c_sort)) CALL ERRQUIT('ccsdtq_lambda1_6_5_
     &2',11,MA_ERR)
      END IF
      END IF
      END IF
      next = NXTVAL(nprocs)
      END IF
      count = count + 1
      END DO
      END DO
      END DO
      END DO
      next = NXTVAL(-nprocs)
      call GA_SYNC()
      RETURN
      END
      SUBROUTINE ccsdtq_lambda1_6_6(d_a,k_a_offset,d_b,k_b_offset,d_c,k_
     &c_offset)
C     i1 ( h2 p11 h9 h12 )_vt + = -1/2 * Sum ( p3 p4 ) * t ( p3 p4 h9 h12 )_t * v ( h2 p11 p3 p4 )_v
      IMPLICIT NONE
