     &k_sym+p6b-1),ieor(int_mb(k_sym+h3b-1),ieor(int_mb(k_sym+h7b-1),int
     &_mb(k_sym+h8b-1)))))) .eq. irrep_t) THEN
      CALL TCE_RESTRICTED_6(p4b,p5b,p6b,h3b,h7b,h8b,p4b_1,p5b_1,p6b_1,h3
     &b_1,h7b_1,h8b_1)
