      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(h8b_1
     & - 1 + noab * (h3b_1 - 1 + noab * (h7b_1 - 1 + noab * (p6b_1 - noa
