     &IT('ccsdtq_lambda1_12_1',9,MA_ERR)
      CALL TCE_SORT_2(dbl_mb(k_c_sort),dbl_mb(k_c),int_mb(k_range+p12b-1
     &),int_mb(k_range+p11b-1),2,1,1.0d0,.false.)
