     &,int_mb(k_range+h6b-1),int_mb(k_range+p12b-1),int_mb(k_range+p3b-1
     &),3,2,1,4,-1.0d0,.false.)
      END IF
      IF (.not.MA_POP_STACK(l_b)) CALL ERRQUIT('ccsdtq_lambda1_12_2',6,M
     &A_ERR)
