      SUBROUTINE ccsdtq_lambda1_15_1(d_a,k_a_offset,d_b,k_b_offset,d_c,k
     &_c_offset)
C     i1 ( h2 h14 h12 h13 )_yt + = 1 * Sum ( p4 p3 ) * t ( p3 p4 h12 h13 )_t * y ( h2 h14 p3 p4 )_y
      IMPLICIT NONE
#include "global.fh"
#include "mafdecls.fh"
#include "sym.fh"
#include "errquit.fh"
#include "tce.fh"
      INTEGER d_a
