     &(k_sym+h12b-1),int_mb(k_sym+h13b-1)))) .eq. ieor(irrep_y,irrep_t))
     & THEN
      IF ((.not.restricted).or.(int_mb(k_spin+h2b-1)+int_mb(k_spin+h14b-
     &1)+int_mb(k_spin+h12b-1)+int_mb(k_spin+h13b-1).ne.8)) THEN
      addr = addr + 1
      dbl_mb(k_a_offset+addr) = dfloat(h13b - 1 + noab * (h12b - 1 + noa
     &b * (h14b - 1 + noab * (h2b - 1))))
      dbl_mb(k_a_offset+length+addr) = size
      size = size + dfloat(int_mb(k_range+h2b-1)) * dfloat(int_mb(k_rang
     &e+h14b-1)) * dfloat(int_mb(k_range+h12b-1)) * dfloat(int_mb(k_rang
     &e+h13b-1))
      END IF
      END IF
      END IF
      END DO
