      DO h13b = h12b,noab
      IF (next .eq. count) THEN
      IF ((.not.restricted).or.(int_mb(k_spin+h2b-1)+int_mb(k_spin+h14b-
     &1)+int_mb(k_spin+h12b-1)+int_mb(k_spin+h13b-1).ne.8)) THEN
      IF (int_mb(k_spin+h2b-1)+int_mb(k_spin+h14b-1) .eq. int_mb(k_spin+
     &h12b-1)+int_mb(k_spin+h13b-1)) THEN
      IF (ieor(int_mb(k_sym+h2b-1),ieor(int_mb(k_sym+h14b-1),ieor(int_mb
     &(k_sym+h12b-1),int_mb(k_sym+h13b-1)))) .eq. ieor(irrep_y,irrep_t))
     & THEN
      dimc = int_mb(k_range+h2b-1) * int_mb(k_range+h14b-1) * int_mb(k_r
     &ange+h12b-1) * int_mb(k_range+h13b-1)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimc,'noname',l_c_sort,k_c_sort)) 
     &CALL ERRQUIT('ccsdtq_lambda1_15_2',0,MA_ERR)
      CALL DFILL(two*dimc,0.0d0,dbl_mb(k_c_sort),1)
      DO p3b = noab+1,noab+nvab
      DO p4b = p3b,noab+nvab
      DO p5b = p4b,noab+nvab
      DO h6b = 1,noab
      IF (int_mb(k_active+p3b-1)+int_mb(k_active+p4b-1)+int_mb(k_active+
     &p5b-1) .ge. numact) THEN
      IF (int_mb(k_active+h12b-1)+int_mb(k_active+h13b-1)+int_mb(k_activ
     &e+h6b-1) .ge. numact) THEN
      IF (int_mb(k_active+h2b-1)+int_mb(k_active+h14b-1)+int_mb(k_active
     &+h6b-1) .ge. numact) THEN
      IF (int_mb(k_active+p3b-1)+int_mb(k_active+p4b-1)+int_mb(k_active+
     &p5b-1) .ge. numact) THEN
      IF (int_mb(k_spin+p3b-1)+int_mb(k_spin+p4b-1)+int_mb(k_spin+p5b-1)
     & .eq. int_mb(k_spin+h12b-1)+int_mb(k_spin+h13b-1)+int_mb(k_spin+h6
     &b-1)) THEN
      IF (ieor(int_mb(k_sym+p3b-1),ieor(int_mb(k_sym+p4b-1),ieor(int_mb(
     &k_sym+p5b-1),ieor(int_mb(k_sym+h12b-1),ieor(int_mb(k_sym+h13b-1),i
     &nt_mb(k_sym+h6b-1)))))) .eq. irrep_t) THEN
      CALL TCE_RESTRICTED_6(p3b,p4b,p5b,h12b,h13b,h6b,p3b_1,p4b_1,p5b_1,
     &h12b_1,h13b_1,h6b_1)
      CALL TCE_RESTRICTED_6(h2b,h14b,h6b,p3b,p4b,p5b,h2b_2,h14b_2,h6b_2,
     &p3b_2,p4b_2,p5b_2)
      dim_common = int_mb(k_range+p3b-1) * int_mb(k_range+p4b-1) * int_m
     &b(k_range+p5b-1) * int_mb(k_range+h6b-1)
      dima_sort = int_mb(k_range+h12b-1) * int_mb(k_range+h13b-1)
      dima = dim_common * dima_sort
