     &CALL ERRQUIT('ccsdtq_lambda1_15_2',1,MA_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dima,'noname',l_a,k_a)) CALL ERRQU
     &IT('ccsdtq_lambda1_15_2',2,MA_ERR)
      IF ((h6b .le. h12b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(h13b_
     &1 - 1 + noab * (h12b_1 - 1 + noab * (h6b_1 - 1 + noab * (p5b_1 - n
     &oab - 1 + nvab * (p4b_1 - noab - 1 + nvab * (p3b_1 - noab - 1)))))
     &))
      CALL TCE_SORT_6(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+p3b-1)
     &,int_mb(k_range+p4b-1),int_mb(k_range+p5b-1),int_mb(k_range+h6b-1)
     &,int_mb(k_range+h12b-1),int_mb(k_range+h13b-1),6,5,4,3,2,1,1.0d0,.
     &false.)
      END IF
      IF ((h12b .lt. h6b) .and. (h6b .le. h13b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(h13b_
     &1 - 1 + noab * (h6b_1 - 1 + noab * (h12b_1 - 1 + noab * (p5b_1 - n
     &oab - 1 + nvab * (p4b_1 - noab - 1 + nvab * (p3b_1 - noab - 1)))))
     &))
      CALL TCE_SORT_6(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+p3b-1)
     &,int_mb(k_range+p4b-1),int_mb(k_range+p5b-1),int_mb(k_range+h12b-1
     &),int_mb(k_range+h6b-1),int_mb(k_range+h13b-1),6,4,5,3,2,1,-1.0d0,
     &.false.)
      END IF
      IF ((h13b .lt. h6b)) THEN
      CALL GET_HASH_BLOCK(d_a,dbl_mb(k_a),dima,dbl_mb(k_a_offset),(h6b_1
     & - 1 + noab * (h13b_1 - 1 + noab * (h12b_1 - 1 + noab * (p5b_1 - n
     &oab - 1 + nvab * (p4b_1 - noab - 1 + nvab * (p3b_1 - noab - 1)))))
     &))
      CALL TCE_SORT_6(dbl_mb(k_a),dbl_mb(k_a_sort),int_mb(k_range+p3b-1)
     &,int_mb(k_range+p4b-1),int_mb(k_range+p5b-1),int_mb(k_range+h12b-1
     &),int_mb(k_range+h13b-1),int_mb(k_range+h6b-1),5,4,6,3,2,1,1.0d0,.
     &false.)
      END IF
      IF (.not.MA_POP_STACK(l_a)) CALL ERRQUIT('ccsdtq_lambda1_15_2',3,M
     &A_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimb,'noname',l_b_sort,k_b_sort)) 
     &CALL ERRQUIT('ccsdtq_lambda1_15_2',4,MA_ERR)
      IF (.not.MA_PUSH_GET(mt_dbl,two*dimb,'noname',l_b,k_b)) CALL ERRQU
     &IT('ccsdtq_lambda1_15_2',5,MA_ERR)
      IF ((h6b .le. h14b) .and. (h14b .lt. h2b)) THEN
      CALL GET_HASH_BLOCK(d_b,dbl_mb(k_b),dimb,dbl_mb(k_b_offset),(p5b_2
     & - noab - 1 + nvab * (p4b_2 - noab - 1 + nvab * (p3b_2 - noab - 1 
     &+ nvab * (h2b_2 - 1 + noab * (h14b_2 - 1 + noab * (h6b_2 - 1))))))
     &)
      CALL TCE_SORT_6(dbl_mb(k_b),dbl_mb(k_b_sort),int_mb(k_range+h6b-1)
     &,int_mb(k_range+h14b-1),int_mb(k_range+h2b-1),int_mb(k_range+p3b-1
     &),int_mb(k_range+p4b-1),int_mb(k_range+p5b-1),2,3,1,6,5,4,1.0d0,.f
     &alse.)
      END IF
      IF ((h14b .lt. h6b) .and. (h6b .lt. h2b)) THEN
      CALL GET_HASH_BLOCK(d_b,dbl_mb(k_b),dimb,dbl_mb(k_b_offset),(p5b_2
     & - noab - 1 + nvab * (p4b_2 - noab - 1 + nvab * (p3b_2 - noab - 1 
