     &(k_sym+h14b-1),int_mb(k_sym+p11b-1)))) .eq. ieor(irrep_y,irrep_t))
     & THEN
      IF ((.not.restricted).or.(int_mb(k_spin+h2b-1)+int_mb(k_spin+p12b-
     &1)+int_mb(k_spin+h14b-1)+int_mb(k_spin+p11b-1).ne.8)) THEN
      addr = addr + 1
      dbl_mb(k_a_offset+addr) = dfloat(p11b - noab - 1 + nvab * (h14b - 
     &1 + noab * (p12b - noab - 1 + nvab * (h2b - 1))))
      dbl_mb(k_a_offset+length+addr) = size
      size = size + dfloat(int_mb(k_range+h2b-1)) * dfloat(int_mb(k_rang
     &e+p12b-1)) * dfloat(int_mb(k_range+h14b-1)) * dfloat(int_mb(k_rang
     &e+p11b-1))
      END IF
      END IF
      END IF
      END DO
      END DO
